/* ONE light UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
html {
  font-size: 11px;
}
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.archive-editor {
  background-color: #ffffff;
  overflow: auto;
}
.archive-editor .archive-container {
  height: 100%;
  width: 100%;
}
.archive-editor .archive-container .inset-panel {
  border-width: 0;
}
.archive-editor .archive-container .inset-panel .panel-heading {
  border-radius: 0;
}
.archive-editor .archive-container .archive-tree {
  padding: 5px;
}
